using HackerRankSolutions.PalindromeIndex;

namespace HackerRankSolutionsTest
{
    public class PalindromeIndexTest
    {
        [Fact]
        public void Test1()
        {
            string s = "bcbc";
            var result = PalindromeIndex.Solve(s);
            Assert.Equal(0, result);
        }

        [Fact]
        public void Test2()
        {
            string s = "aaab";
            var result = PalindromeIndex.Solve(s);
            Assert.Equal(3, result);
        }

        [Fact]
        public void Test3()
        {
            string s = "baa";
            var result = PalindromeIndex.Solve(s);
            Assert.Equal(0, result);
        }

        [Fact]
        public void Test4()
        {
            string s = "aaa";
            var result = PalindromeIndex.Solve(s);
            Assert.Equal(-1, result);
        }

        [Fact]
        public void Test5()
        {
            string s = "";
            var result = PalindromeIndex.Solve(s);
            Assert.Equal(24988, result);
        }
    }
}
